import React from 'react'

import '../../features/linkItemAdd/linkItemAddStyle.css'

const LinkItemAdd = () => {
  return (
    <div className='linkItemAdd'>
      <input className='linkItemAddInput' placeholder='Add new link'></input>
      <button className='linkItemAddBtn'>Add</button> 
    </div>
  )
}

export default LinkItemAdd
